('2136','23','6066','Hotel Playas del Rey',Null,'Schickes Hotel im Miami-Style mit 64 Zimmern','30369','Dieses Hotel, das sich südwestlich von Palma befindet, wurde 1968 auf einem ca. 1.390 m² großen Grundstück erstellt und wurde zwischenzeitlich mehrmals saniert, das letzte Mal im Jahr 2011.  Die 64 Doppelzimmer sowie die restlichen Räumlichkeiten verteilen sich auf ca. 2.390 m² Nutzfläche.  Alle Zimmer sind mit Balkon, Badezimmer, Klimaanlage w/k, W-LAN und Flachbildschirm-TV ausgestattet. Das Hotel bietet noch einen Außenpool, eine schicke Lounge und ein Restaurant. Zum Strand sind es nur 100 m.','30370','5200000','111','2013-12-11 14:11:57','110','2013-12-11 14:12:46',Null,'2040','1','970',1,'1','0',Null,Null,'auf Anfrage','30371',Null,'0','0','0',Null,'2015-04-21 14:26:28',1,'0',Null,Null,Null,Null,'5',0,1,1,'0','1','1',1,1,Null,'30372',Null,'30373',Null,'30374',Null,'30375',Null,'30376','0',0,'0');
